import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Signup from "./Components/Auth/Signup"; // Import your Signup component
import Login from "./Components/Auth/Login"; // Import Login component
import Dashboard from "./Components/Dashboard"; // Import Dashboard component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/signup" element={<Signup />} /> {/* Your signup page */}
        <Route path="/login" element={<Login />} /> {/* Your login page */}
        <Route path="/dashboard" element={<Dashboard />} /> {/* Dashboard page */}
        {/* You can add more routes here */}
      </Routes>
    </Router>
  );
}

export default App;
